<div class="modal fade" id="exampleModal" tabindex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
    <div class="modal-dialog">
        <div class="modal-content">
            <div class="modal-header">
                <!--<h5 class="modal-title" id="exampleModalLabel">Чего Вам не хватает на этом сайте?</h5>-->
                <button type="button" class="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
            </div>

            <form>
                <div class="modal-body">
                    <div class="mb-3">
                        <label for="recipient-name" class="col-form-label">Имя:</label>
                        <input name="name" type="text" class="form-control recipient_name" id="recipient-name" placeholder="Как к вам обращаться?">
                    </div>
                    <div class="mb-3">
                        <label for="recipient-email" class="col-form-label">Электронная почта:</label>
                        <input name="email" type="email" class="form-control recipient_email" id="recipient-email" placeholder="Как с вами можно связаться?">
                    </div>
                    <div class="mb-3">
                        <label for="message-text" class="col-form-label">Обращение:</label>
                        <textarea name="text" class="form-control message_text" id="message-text" placeholder="Напишите здесь ваше предложение или пожелание." required></textarea>
                    </div>
                </div>
                <div class="modal-footer">
                    <button type="button" class="btn btn-outline-secondary add_feedback">Отправить</button>
                </div>
            </form>
        </div>
    </div>
